import React, {Component} from 'react';
import {data} from '../data';
import Article from './article';

class articlelist extends Component {
    
    constructor(){
        super()
        this.state = {
            articles: data,
            tableOfContent: [] 
        }
    }
    
    componentDidMount(){
        
        this.state.articles.map((value,index)=>{
            var object={
                title:value.title,
                date:value.date
            }
            this.state.tableOfContent.push(object)
        })
        console.log(this.state.tableOfContent)
    
    }
    
    render(){
 
        return(
                <React.Fragment>
                    <Article/>
                </React.Fragment>

            
        )
    }
}

                                
export default articlelist;
